import React, { Component } from 'react'
import CustomerData from './CustomerData'

class CustomerList extends Component {
    constructor (props){
        super(props)
        this.state={
            ListItems : ['Swati', 'Riddhi','Pihu','Sanjay']
        }
        }
    
    render() {
        return(
        <div>
            <ul>
                {this.state.ListItems.map((EachItem , index)=> <CustomerData item = {EachItem} key = {index}/> )}
            </ul>
            
        </div>
        )
    }
    
        
        
    }


export default CustomerList
